const API_KEY= "00dbfd406a0acaaecc568e7ea6a34ce5";
const BASE_URL="https://api.openweathermap.org/data/2.5/weather?q={city name}&appid={API KEY}"
 
 const getWeatherData = (infoType, seachParams) => {
    const url = new URL(BASE_URL + "/" + infoType);
    url.search = new URL({...seachParams, appid: 
    API_KEY });

    return fetch(url)
    .then((res) => res.json())
    .then((data) => data);
 }

 export default getWeatherData;
